article_content:
냄새 뺀다고 세탁기 돌렸더니 약간 너덜해졌네요...^.^;;
냄새는 하루 정도 지나니 빠졌구요.
크기도 커서 솜이불도 보관 가능합니다.

대형 극세사 이불 넣을 곳이 마땅치 않아 알아보다가 구매하게 되었어요. 기존에 쓰던 리빙박스도 대형이지만 두꺼운 극세사 이불은 들어가지 않더라구요.디자인도 예쁘고 천도 튼튼하고 특대형이라 그런지 확실이 커요~
이불만 넣을 생각이었는데 세트로 산 바닥 매트도 같이 들어가더라구요^^ 2개 구입했는데 하나는 토퍼, 이불세트를 넣을 생각이에요~ 매우매우 만족합니다.
재구매 의사 100%에요~ 가격이 살짝 부담되지만;;
